import { Share } from "@mui/icons-material";
import React from "react";

export const FilePreview = ({ file }) => {
  return (
    <div className="bg-white  group dark:bg-sky-800 hover:bg-gray-200 dark:hover:bg-sky-900 active:scale-95 duration-200 cursor-pointer rounded-lg shadow-md h-fit w-full p-3 flex flex-col gap-2 ">
      <div className="overflow-hidden">
        <img
          src={file.img}
          className="w-full object-cover aspect-video origin-top rounded group-hover:scale-105 duration-200"
          alt=""
        />
      </div>
      <div className="flex justify-between items-center">
        <div className="flex flex-col gap-1">
          <h2 className="text-sky-900 dark:text-sky-100 font-bodyFont font-semibold text-sm ">
            IMG_09
          </h2>
          <h6 className="text-sky-400 font-bodyFont text-xs">July 24, 2023</h6>
        </div>
        <div className="text-sky-950 dark:text-white hover:bg-gray-200 dark:hover:bg-sky-900 duration-200">
          <Share fontSize="small" />
        </div>
      </div>
    </div>
  );
};
